import React from "react";
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import Container from "@mui/material/Container";
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import './Home.css'

export default function Home() {
  return (
    <div className="mainPage">
      <AppBar position="static" style={{ backgroundColor:"#80cbc4"}}>
        <Container maxWidth="90%">
          <Toolbar disableGutters>
            <img
              src="https://vyaparwebsiteimages.vypcdn.in/logo1.svg"
              style={{ width: "20%" }}
            />

            <Stack direction="row" spacing={2}>
              <Button href="/Home" style={{color:"black", fontSize:"30px" }}>Home</Button>
              <Button href="/Home" style={{color:"black", fontSize:"30px" }}>User</Button>
              <Button href="/invoice" style={{color:"black", fontSize:"30px" }}>Invoice</Button>
              <Button href="/MainContent" style={{color:"black", fontSize:"30px" }}>Create Invoice</Button>
              <Button href="" style={{color:"black", fontSize:"30px" }}>About</Button>
            </Stack>
            <Button variant="contained" size="large" style={{marginLeft:"10%"}}>
          Logout
        </Button>
          </Toolbar>
        </Container>
      </AppBar>
    </div>
  );
}
